defs.value:
enum DanceMove {
    Spin {
        length: usize,
    },
    Exchange {
        first: usize,
        second: usize,
    },
    Partner {
        first: char,
        second: char,
    },
}

enum Instruction {
    Sound {
        operand: Operand,
    },
    Set {
        dest: u8,
        value: Operand,
    },
    Add {
        dest: u8,
        value: Operand,
    },
    Mul {
        dest: u8,
        value: Operand,
    },
    Mod {
        dest: u8,
        value: Operand,
    },
    Recover {
        operand: Operand,
    },
    Jump {
        test: Operand,
        offset: Operand,
    },
}

enum MainMessage {
    Blocked {
        id: ProcessId,
    },
    Unblocked {
        id: ProcessId,
    },
    Terminated {
        id: ProcessId,
    },
    SentMessage {
        id: ProcessId,
    },
}
